import React from 'react';

const GetTask = (props) => {
  return (
    <div>
      {props.tasks.map((task) => (
        <div>
          <h1>{task.task}</h1> <p>{task.remainder}</p>
        </div>
      ))}
    </div>
  );
};

export default GetTask;
